            return res.text()
        })
        .then(function(data){
            //console.log(data)
            a=data
        })

        for(const i of a){
            console.log(i)
        }
    }
    render(){

        return(
            <div>
                <p id="para">hello world</p>
                <button onClick={this.clickB}>click</button>
            </div>
        )
    }
}
export default Header
